마치 사람 뼈의 세포 중 조골 세포와 파골 세포의 타협이 깨져 모든 세상에 ‘골다공증’이 와 버린 듯하다.
고통의 자각을 낮추기 위해 ‘칼슘’과 ‘마그네슘’ 그리고 ‘비타민D’의 복용을 열심히 한다면 많은 도움이 될 것이다.

애초에 ‘계산 따위는 세상에 적용되지 않는다.’고 깨달은 바 있다.
때문에 내가 할 수 있던 건 남다른 상상을 실천해 버리자는 것이다.
돌연변이의 인식이 될지언정
이해 못할 실행들은 지금 내게 가장 큰 재산으로 남았다.
공적인 자리에서 많이 듣던 말이 있다.
“너 도대체 그걸 왜?”
이유는 그냥 하나라고 생각한다.
내가 행하고 있는 모든 것들은 ‘블루오션’ 이니까.

위기는 또 다른 기회다.
기존의 방식과 생각의 틀에서 벗어나자.

그래도 응원해주고 곁에 있던 사람들은 항상 곁에 있더라.

결실이 조금씩 보인다.
쉼 없이 달려온 결과물들인가.
보답할 일들만 남았다.
